    "2015-01-21T14:27:43.072842",nt"name": "tiger-line-shapefile-2012-series-information-file-for-the-current-topological-faces-polygons-wi",nt"isopen":
    false,nt"url": null,nt"notes": "The TIGER/Line shapefiles and related database
    files (.dbf) are an extract of selected geographic and cartographic information
    from then               U.S. Census Bureau's Master Address File / Topologically
    Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The
    MTDB representsn               a seamless national file with no overlaps or gaps
    between parts, however, each TIGER/Line shapefile is designed to stand alone as
    an independent data set,n               or they can be combined to cover the entire
    nation. Face refers to the areal (polygon) topological primitives that make up MTDB.
    A face is bounded by onen               or more edges; its boundary includes only
    the edges that separate it from other faces, not any interior edges contained within
    the area of the face. Then               Topological Faces Shapefile contains the
    attributes of each topological primitive face. Each face has a unique topological
    face identifier (TFID) value.n               Each face in the shapefile includes
    the key geographic area codes for almost all geographic areas for which the Census
    Bureau tabulates data for both then               2010 Census and Census 2000. The
    geometries of each of these geographic areas can then be built by dissolving the
    face geometries on the appropriate keyn               geographic area codes in the
    Topological Faces Shapefile.",nt"license_title": null,nt"extras": [{ntt"key":
